import { Component } from 'react';
import { Col } from 'react-bootstrap';
import { Row } from 'react-bootstrap';
import { connect } from 'react-redux';

class WhatsOutside extends Component {
    render() {
        return (
            <>
                <Row>
                    <Col lg={{ offset: 1, span: 10 }}>
                        <div className="whatsOutside-body">
                            <div className="whatsOutside-showcase">
                                <div className="whatsOutside-swipeRight">right{">>>>>"}</div>
                                <div className="whatsOutside-swipeLeft">left</div>
                                <div className="whatsOutside-image">img</div>
                            </div>
                        </div>
                    </Col>
                </Row>
            </>
        );
    }
}

export default connect(null, null)(WhatsOutside);
